import Cards from './Cards.js';
import HTML from '/home/kauag/github/portifolio/src/imagens/html-5.png';

export default function Habilidades() {
  const list = {
    HTML: {
      title: 'HTML',
      img: '/home/kauag/github/portifolio/src/imagens/html-5.png',
      alt: 'HTML icone',
    },
  };
  return (
    <section className="container" style={{ flexDirection: 'column' }}>
      <h1 id="habilidades">Minhas Habilidades e Competencias</h1>
      <div className="card-habilits">
        <Cards title={list.HTML.title} img={HTML} alt={list.HTML.alt} />
        <Cards title={list.HTML.title} img={HTML} alt={list.HTML.alt} />
        <Cards title={list.HTML.title} img={HTML} alt={list.HTML.alt} />
